import {useState} from 'react';

const ExerciseDisplay = () => {
    const [exercises, setExercises] = useState([
        {name: "Jump Lunges", reprange: 15, id:1 }, 
        {name: "Burpees", reprange: 10, id: 2},
        {name: "Pushups", reprange: 10, id: 3}, 
        {name: "Explosive Situps", reprange: 20, id: 4}
    ])

    return(
        <div><h1> Exercises </h1>
        { exercises.map((exercise) => (
            <div className = "exercise-details" key={exercise.id}>
                <h2> {exercise.name} <span> Reps: {exercise.reprange}</span></h2>
            </div>
        )
        )}
        </div>
    );
}
export default ExerciseDisplay;
